# modify the humidity to be suitable for regression
reg_df.loc[:,'Humidity (%)']=reg_df['Humidity (%)']/100
reg_df.rename(columns={'Humidity (%)': 'Humidity'}, inplace=True)
reg_df

# Spliting to x , y
X = reg_df[['Humidity', 'Barometer (inHg)']]
y = reg_df[['Temperature(°C)']]

# Scale the target
target_scaler = StandardScaler()
y_scaled = target_scaler.fit_transform(y)

# Spliting the data to train and test
X_train, X_test, y_train_scaled, y_test_scaled = train_test_split(X, y_scaled, test_size=0.2, random_state=42)

# Scaling the features
scaler = StandardScaler()
X_train_scaled = scaler.fit_transform(X_train)
X_test_scaled = scaler.transform(X_test)

# Performing the multiple regression
model=LinearRegression()
model.fit(X_train_scaled,y_train_scaled)

# predict the test data
y_pred_scaled=model.predict(X_test_scaled)
y_pred_scaled

# Inverse transform predictions to original scale
y_pred = target_scaler.inverse_transform(y_pred_scaled)
y_test = target_scaler.inverse_transform(y_test_scaled)

# Detecting the error
mse=mean_squared_error(y_test,y_pred)
r2=r2_score(y_test,y_pred)

print(f"Mean Squared Error: {mse:.2f}")
print(f"R-squared: {r2:.2f}")

